import "./Form.scss";
import Fon from './'

export const Form = () => {
  return (
    <>
      <div className="Form">
        <div className="Form-Title">Уточнить детали</div>
        <div className="Form-Desc">
          Если вы не нашли ответа на свой вопрос, заполните эту форму, а мы как
          можно быстрее ответим вам.
        </div>
        <div>
          <div></div>
          <div>
            <img />
          </div>
        </div>
      </div>
    </>
  );
};
